import React from "react";
import empsvg from "./../assets/Emp.svg";
import persvg from "./../assets/person.svg";
import telsvg from './../'
import "./Employee.css";
const Employee = (props) => {
  return (
    <section className="empdiv">
      <div className="empicon">
        <img className="image-size" src={empsvg} alt="My Happy SVG" />
      </div>
      <div className="empinfo">
        <div className="int">
          <label className="lbl">نام خانواده گی :‌علی آبادی</label>
          <div className="pericon">
            <img src={persvg} alt="My Happy SVG" />
          </div>
        </div>
        <div className="int">
          <label className="lbl">نام:‌علی</label>
          <div className="pericon">
            <img src={persvg} alt="My Happy SVG" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Employee;
